import Header from "./Header";
import {Link} from "react-router-dom";

function Error() {
  return(
    <>
      <Header />
      <div className="error">Страница не найдена.</div>
      <Link to="/" className="authorization__login-text">На главную.</Link>
    </>
  );
}

export default Error;
